import React from 'react';

const frontendQandA = [
  {
    question: 'Which is more important: flexibility, comprehensiveness?',
    answer1: 'Flexibility',
    answer2: 'Comprehensiveness',
  },
  {
    question: 'Do you know or want to learn TypeScript?',
    answer1: 'Yes',
    answer2: 'No',
  },
  {
    question:
      'Which is more important: an easy learning curve or a robust ecosystem?',
    answer1: 'Learning curve',
    answer2: 'Ecosystem/developer tooling',
  },
  {
    question: 'Which is more important: flexibility, comprehensiveness?',
    answer1: 'Flexibility',
    answer2: 'Comprehensiveness',
  },
  {
    question: 'Which is more important: flexibility, comprehensiveness?',
    answer1: 'Flexibility',
    answer2: 'Comprehensiveness',
  },
];

const content = frontendQandA.map((el) => {
  return (
    <div>
      <p>
        <strong>{el.question}</strong>
      </p>
      <p>{el.answer1}</p>
      <p>{el.answer2}</p>
    </div>
  );
});

const FrontendContent = () => {
  return <div>{content}</div>;
};

export default FrontendContent;
